import React, { useState, useEffect } from "react";

import InfoCard from "../components/Cards/InfoCard";
import PageTitle from "../components/Typography/PageTitle";
import { FaUsers } from "react-icons/fa";
import { SiUnacademy } from "react-icons/si";
import { SiCoursera } from "react-icons/si";
import { SiNextra } from "react-icons/si";
import { Card, CardBody } from "@windmill/react-ui";
import { GoDotFill } from 'react-icons/go';

import SectionTitle from "../components/Typography/SectionTitle";

import RoundIcon from "../components/RoundIcon";

function Dashboard() {
  return (
    <>
      <PageTitle>Dashboard</PageTitle>
      <div className="grid gap-6 mb-8 md:grid-cols-2 xl:grid-cols-4">
        <InfoCard title="Total Students" value="7299">
          <RoundIcon
            icon={FaUsers}
            iconColorClass="text-orange-500 dark:text-orange-100"
            bgColorClass="bg-orange-100 dark:bg-orange-500"
            className="mr-4"
          />
        </InfoCard>

        <InfoCard title="Total Departments" value="21">
          <RoundIcon
            icon={SiUnacademy}
            iconColorClass="text-green-500 dark:text-green-100"
            bgColorClass="bg-green-100 dark:bg-green-500"
            className="mr-4"
          />
        </InfoCard>

        <InfoCard title="Open Elective Courses" value="25">
          <RoundIcon
            icon={SiCoursera}
            iconColorClass="text-blue-500 dark:text-blue-100"
            bgColorClass="bg-blue-100 dark:bg-blue-500"
            className="mr-4"
          />
        </InfoCard>

        <InfoCard title="Elective Courses" value="35">
          <RoundIcon
            icon={SiNextra}
            iconColorClass="text-teal-500 dark:text-teal-100"
            bgColorClass="bg-teal-100 dark:bg-teal-500"
            className="mr-4"
          />
        </InfoCard>
      </div>
      <div>
        <SectionTitle>Instructions</SectionTitle>

        <Card className="mb-8 shadow-md">
          <CardBody>
            <p className="text-sm text-gray-600 dark:text-gray-400">
              Large, full width sections goes here
            </p>
          </CardBody>
        </Card>
      </div>
    </>
  );
}

export default Dashboard;
